import React from "react";
import Header from "./component/Header/Index";
import TextField from "@mui/material/TextField";

function App() {
  return (
    <div className="App">
      <Header />
      <div className="app_body">
        <div className="inputs">
          <div className="search-inputs">
            <TextField
              id="outlined-basic"
              label="Outlined"
              variant="outlined"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
